import React, {Component} from 'react'
import FeedItem from './feedItem'

class unregisteredFeed extends Component{

style = {
    overflow: 'scroll',
    height: '350px'
}

shouldComponentUpdate(){
    return true 
}

render(){

    let feedList = []

    let updateFeedList = setInterval(()=>{
        feedList.push(<FeedItem>abcdef</FeedItem>)
    }, 3000)

    return(
    <div style={this.style}>
        <h1>Unregistered Activity</h1>
        {setInterval(updateFeedList, 3000)}
        {feedList}
    </div>)}
}


export default unregisteredFeed
